:7:"caption";s:1010:"Aicon Art in Museums!🏛🖼

S. H. Raza next to #markrothko at Louvre Abu Dhabi for a lesson in sublimation.

Bindu
1986
Acrylic on canvas
120.4 x 120.4 x 1.8 cm

The Indian painter Sayed Haider Raza (1922–2016) studied in India before obtaining a scholarship to the Paris School of Fine Arts in the early 1950s. He settled in France in 1962 but returned to India every year. His work is characterised by this dual heritage, to which he gave formal expression at the end of the 1970s. The black dot of the Bindu, a symbol of Hindu spirituality, as well as of Indian art, the sowing of seed, aesthetics and the understanding of life, is also a visible form containing all the requirements of line, tone, colour, texture and space. For Raza it is therefore the embodiment "par excellence" of his dual culture – Indian and formal, or indeed formalist.

